  for (var i = 0; i < data.length ; i++) {
    console.log(data[i].text);
  }
})

class Savings extends Component {

    render() {
        return (
            <div>
                <Navigation />
                <img id="savings" src={savings} className="pageImg"/>
                <h3 className="pageHeader">SAVINGS</h3>
            </div>
        );
    }
}

export default Savings;
